//@ts-check

import stylistic from "@stylistic/eslint-plugin";
import pathAlias from "eslint-plugin-path-alias";
import header from "eslint-plugin-simple-header";
import importSort from "eslint-plugin-simple-import-sort";
import unusedImports from "eslint-plugin-unused-imports";
import tseslint from "typescript-eslint";
import prettier from "eslint-plugin-prettier";

export default tseslint.config(
    { ignores: ["dist"] },

    {
        files: ["src/**/*.{tsx,ts,mts,mjs,js,jsx}"],
        plugins: {
            header,
            stylistic,
            importSort,
            unusedImports,
            pathAlias,
            prettier
        },
        settings: {
            "import/resolver": {
                alias: {
                    map: []
                }
            }
        },
        languageOptions: {
            parser: tseslint.parser,
            parserOptions: {
                project: true,
                tsconfigRootDir: import.meta.dirname
            }
        },
        rules: {
            "header/header": [
                "error",
                {
                    files: ["scripts/header.txt"]
                }
            ],

            // ESLint Rules

            yoda: "error",
            eqeqeq: ["error", "always", { null: "ignore" }],
            "prefer-destructuring": [
                "error",
                {
                    VariableDeclarator: { array: false, object: true },
                    AssignmentExpression: { array: false, object: false }
                }
            ],
            "operator-assignment": ["error", "always"],
            "no-useless-computed-key": "error",
            "no-unneeded-ternary": ["error", { defaultAssignment: false }],
            "no-invalid-regexp": "error",
            "no-constant-condition": ["error", { checkLoops: false }],
            "no-duplicate-imports": "error",
            "dot-notation": "error",
            "no-useless-escape": "error",
            "no-fallthrough": "error",
            "for-direction": "error",
            "no-async-promise-executor": "error",
            "no-cond-assign": "error",
            "no-dupe-else-if": "error",
            "no-duplicate-case": "error",
            "no-irregular-whitespace": "error",
            "no-loss-of-precision": "error",
            "no-misleading-character-class": "error",
            "no-prototype-builtins": "error",
            "no-regex-spaces": "error",
            "no-shadow-restricted-names": "error",
            "no-unexpected-multiline": "error",
            "no-unsafe-optional-chaining": "error",
            "no-useless-backreference": "error",
            "use-isnan": "error",
            "prefer-const": "error",
            "prefer-spread": "error",

            // Styling Rules
            "stylistic/spaced-comment": ["error", "always", { markers: ["!"] }],
            "stylistic/no-extra-semi": "error",

            // Plugin Rules
            "importSort/imports": "error",
            "importSort/exports": "error",
            "unusedImports/no-unused-imports": "error",
            "pathAlias/no-relative": "error",
            "prettier/prettier": "error"
        }
    }
);

{
    "name": "vesktop",
    "version": "1.5.4",
    "private": true,
    "description": "Vesktop is a custom Discord desktop app",
    "keywords": [],
    "homepage": "https://vencord.dev/",
    "license": "GPL-3.0",
    "author": "Vendicated <vendicated@riseup.net>",
    "main": "dist/js/main.js",
    "scripts": {
        "build": "tsx scripts/build/build.mts",
        "build:dev": "pnpm build --dev",
        "package": "pnpm build && electron-builder",
        "package:dir": "pnpm build && electron-builder --dir",
        "lint": "eslint",
        "lint:fix": "pnpm lint --fix",
        "start": "pnpm build && electron .",
        "start:dev": "pnpm build:dev && electron .",
        "start:watch": "pnpm build:dev && tsx scripts/startWatch.mts",
        "test": "pnpm lint && pnpm testTypes",
        "testTypes": "tsc --noEmit",
        "watch": "pnpm build --watch",
        "updateMeta": "tsx scripts/utils/updateMeta.mts"
    },
    "dependencies": {
        "arrpc": "github:OpenAsar/arrpc#5aadc307cb9bf4479f0a12364a253b07a77ace22",
        "electron-updater": "^6.3.9"
    },
    "optionalDependencies": {
        "@vencord/venmic": "^6.1.0"
    },
    "devDependencies": {
        "@fal-works/esbuild-plugin-global-externals": "^2.1.2",
        "@stylistic/eslint-plugin": "^2.11.0",
        "@types/node": "^22.10.1",
        "@types/react": "^18.3.12",
        "@vencord/types": "^1.8.4",
        "dotenv": "^16.4.6",
        "electron": "^33.2.1",
        "electron-builder": "^25.1.8",
        "esbuild": "^0.24.0",
        "eslint": "^9.16.0",
        "eslint-import-resolver-alias": "^1.1.2",
        "eslint-plugin-path-alias": "^2.1.0",
        "eslint-plugin-prettier": "^5.2.1",
        "eslint-plugin-simple-header": "^1.2.1",
        "eslint-plugin-simple-import-sort": "^12.1.1",
        "eslint-plugin-unused-imports": "^4.1.4",
        "prettier": "^3.4.1",
        "source-map-support": "^0.5.21",
        "tsx": "^4.19.2",
        "type-fest": "^4.30.0",
        "typescript": "^5.7.2",
        "typescript-eslint": "^8.17.0",
        "xml-formatter": "^3.6.3"
    },
    "packageManager": "pnpm@9.1.0",
    "engines": {
        "node": ">=18",
        "pnpm": ">=8"
    },
    "build": {
        "appId": "dev.vencord.vesktop",
        "productName": "Vesktop",
        "files": [
            "!*",
            "!node_modules",
            "dist/js",
            "static",
            "package.json",
            "LICENSE"
        ],
        "beforePack": "scripts/build/sandboxFix.js",
        "linux": {
            "icon": "build/icon.icns",
            "category": "Network",
            "maintainer": "vendicated+vesktop@riseup.net",
            "target": [
                {
                    "target": "deb",
                    "arch": [
                        "x64",
                        "arm64"
                    ]
                },
                {
                    "target": "tar.gz",
                    "arch": [
                        "x64",
                        "arm64"
                    ]
                },
                {
                    "target": "rpm",
                    "arch": [
                        "x64",
                        "arm64"
                    ]
                },
                {
                    "target": "AppImage",
                    "arch": [
                        "x64",
                        "arm64"
                    ]
                }
            ],
            "desktop": {
                "Name": "Vesktop",
                "GenericName": "Internet Messenger",
                "Type": "Application",
                "Categories": "Network;InstantMessaging;Chat;",
                "Keywords": "discord;vencord;electron;chat;"
            }
        },
        "mac": {
            "target": [
                {
                    "target": "default",
                    "arch": [
                        "universal"
                    ]
                }
            ],
            "category": "public.app-category.social-networking",
            "darkModeSupport": true,
            "extendInfo": {
                "NSMicrophoneUsageDescription": "This app needs access to the microphone",
                "NSCameraUsageDescription": "This app needs access to the camera",
                "com.apple.security.device.audio-input": true,
                "com.apple.security.device.camera": true
            },
            "notarize": true
        },
        "dmg": {
            "background": "build/background.tiff",
            "icon": "build/icon.icns",
            "iconSize": 105,
            "window": {
                "width": 512,
                "height": 340
            },
            "contents": [
                {
                    "x": 140,
                    "y": 160
                },
                {
                    "x": 372,
                    "y": 160,
                    "type": "link",
                    "path": "/Applications"
                }
            ]
        },
        "nsis": {
            "include": "build/installer.nsh",
            "oneClick": false
        },
        "win": {
            "target": [
                {
                    "target": "nsis",
                    "arch": [
                        "x64",
                        "arm64"
                    ]
                },
                {
                    "target": "zip",
                    "arch": [
                        "x64",
                        "arm64"
                    ]
                }
            ]
        },
        "publish": {
            "provider": "github"
        },
        "rpm": {
            "fpm": [
                "--rpm-rpmbuild-define=_build_id_links none"
            ]
        }
    },
    "pnpm": {
        "patchedDependencies": {
            "arrpc@3.5.0": "patches/arrpc@3.5.0.patch"
        }
    }
}

